import React, { useState } from 'react';
import { get } from '../api';

export default function ExpensesList(){
  const [email, setEmail] = useState('');
  const [expenses, setExpenses] = useState([]);

  async function load(){
    const res = await get('/expenses/' + email);
    setExpenses(res);
  }

  return (
    <div>
      <h3>Expenses</h3>
      <input placeholder="User Email" value={email} onChange={e=>setEmail(e.target.value)} />
      <button onClick={load}>Load</button>
      <ul>
        {expenses.map(e => (
          <li key={e.id}>
            {e.original_amount} {e.original_currency} â†’ {e.amount_in_company_currency || 'N/A'} (company currency) | {e.category}
          </li>
        ))}
      </ul>
    </div>
  );
}
